import api from "../api";

function Musicas() {
  function teste() {
    api.get().then((res) => {
      console.log(res);
    })
    .catch((erro) => {
        console.log(erro)
    })
  }

  return (
    <>
      <h1>Titulo</h1>

      <button onClick={teste}>Teste</button>
    </>
  );
}

export default Musicas;
